import React, { useEffect, useState } from "react";
import styled from "styled-components";

const Site = styled.div`
  background: #f8f8f8;
`;
const Header = styled.div`
  background: #847577;
  width: auto;
  height: 100px;
`;
const HeaderImage = styled.div``;
const ButtonHeader = styled.div``;
const Searchbar = styled.div``;
const AccountButton = styled.div``;

const Home = () => {
  //const [pokemonData, setPokemondata] = useState([]);
  //const [value, setValue] = useState("");

  useEffect(() => {
    //fetchAllPokemons();
  }, []);

  return (
    <Site>
      <div className="site">
        <Header>
          <div className="header_contents">
            <HeaderImage>
              <div className="header_image_site"></div>
            </HeaderImage>
            <div className="buttons">
              <ButtonHeader>
                <button type="button" className="button_novels">
                  Novels
                </button>
              </ButtonHeader>
              <ButtonHeader>
                <button type="button" className="button_art">
                  Art
                </button>
              </ButtonHeader>
            </div>
            <Searchbar>
              <div className="searchbar_header"></div>
            </Searchbar>
            <AccountButton>
              <div className="account_button"></div>
            </AccountButton>
          </div>
        </Header>
        <div className="container"></div>
      </div>
    </Site>
  );
};

export default Home;
